Input: Statement 1 | If H is a subgroup of a group G and a belongs to G, then aH = Ha. Statement 2 | If H is normal of G and a belongs to G, then ah = ha for all h in H. Choices: a) True, True b) False, False c) True, False d) False, True 
Output:
First, I need to understand the definitions of the terms used in the statements. A subgroup is a subset of a group that is closed under the group operation and contains the identity element and the inverse of each element. A normal subgroup is a subgroup that is invariant under conjugation by any element of the group.
Statement 1 says that if H is a subgroup of G and a belongs to G, then aH = Ha. This is true because the subgroup property is preserved under conjugation by any element of the group.
Statement 2 says that if H is normal of G and a belongs to G, then ah = ha for all h in H. This is also true because the normal subgroup property is preserved under conjugation by any element of the group.
Therefore, both statements are true, so the correct answer is {'sol': 'a'}.

